import Vue from 'vue'
import base64 from 'base64-js'

import {
  VuelogModule,
  registerTemplate,
  TagItem,
  CategoryItem,
  Queries,
  PostGroups,
  Pageable,
  PostList,
  PostSummary,
  Post,
  SortOrder,
  DefaultPageable
} from '@vuelog/front'

import sampleTemplate from '@vuelog/sample-template'
import '@vuelog/sample-template/dist/index.min.css'

Vue.use(VuelogModule)

registerTemplate('sample', sampleTemplate)

const testCategories: Record<string, CategoryItem> = {
  docs: {
    title: 'Documents',
    name: 'docs'
  },
  knowledge: {
    title: 'Knowledge',
    name: 'knowledge'
  },
  ideas: {
    title: 'Ideas',
    name: 'ideas'
  }
}

const testContent = new TextDecoder().decode(base64.toByteArray(''))

const defaultSortOrders: SortOrder[] = [{
  direction: 'desc',
  property: 'creationDate'
}]

function makeTestPost(date: Date, id: string, category: string, tag: string): Post {
  return {
    id: id,
    creationDate: date,
    lastModificationDate: undefined,
    title: id.toUpperCase(),
    author: {
      id: 'Joseph',
      name: 'Joseph'
    },
    contentType: 'markdown',
    content: testContent,
    category: testCategories[category],
    tags: [{
      name: tag,
      title: tag
    }]
  }
}

const testPosts: PostSummary[] = [
  makeTestPost(new Date(2020, 10, 1), 'post-01', 'ideas', 'api'),
  makeTestPost(new Date(2020, 10, 2), 'post-02', 'ideas', 'api'),
  makeTestPost(new Date(2020, 10, 3), 'post-03', 'ideas', 'api'),
  makeTestPost(new Date(2020, 11, 4), 'post-04', 'ideas', 'api'),
  makeTestPost(new Date(2020, 11, 5), 'post-05', 'docs', 'api'),
  makeTestPost(new Date(2020, 11, 6), 'post-06', 'docs', 'api'),
  makeTestPost(new Date(2020, 11, 7), 'post-07', 'ideas', 'api'),
  makeTestPost(new Date(2020, 11, 8), 'post-08', 'knowledge', 'api'),
  makeTestPost(new Date(2020, 11, 9), 'post-09', 'knowledge', 'api'),
  makeTestPost(new Date(2020, 11, 10), 'post-10', 'knowledge', 'restful'),
  makeTestPost(new Date(2020, 12, 11), 'post-11', 'docs', 'restful'),
  makeTestPost(new Date(2020, 12, 12), 'post-12', 'docs', 'restful'),
  makeTestPost(new Date(2020, 12, 13), 'post-13', 'knowledge', 'restful'),
  makeTestPost(new Date(2020, 12, 14), 'post-14', 'knowledge', 'restful'),
  makeTestPost(new Date(2020, 12, 15), 'post-15', 'knowledge', 'restful'),
  makeTestPost(new Date(2020, 12, 16), 'post-16', 'ideas', 'restful')
]

const vuelogInstance = new VuelogModule({
  baseUrl: process.env.BASE_URL,
  handler: {
    start($vuelog) {
      $vuelog.setSiteConfig({
        template: 'default',
        title: 'HELLO WORLD!',
        // baseUrl: process.env.BASE_URL as string,
        post: {
          showTOC: true
        },
        params: {
          headerTitle: 'Hello',
          headerMessage: 'world',
          aboutHtml: `<a href="https://jsty.tistory.com">
              <img style="width: 32px" src="data:image/png;base64," alt="avatar" style="cursor: pointer" />
            </a>
            <p>Engineer Joseph Lee</p>`
        }
      })
    },
    getFeaturedTags(): Promise<TagItem[]> {
      return Promise.resolve([
        {
          title: 'restful',
          name: 'restful'
        },
        {
          title: 'k8s',
          name: 'k8s'
        },
        {
          title: 'api',
          name: 'api'
        }
      ])
    },
    getCategories(): Promise<CategoryItem[]> {
      return Promise.resolve(Object.values(testCategories))
    },
    getPostGroups(/* queries: Queries | null, groupQueries: GroupQueries */): Promise<PostGroups> {
      return Promise.resolve([
        {
          title: '2020.12',
          count: 5,
          queries: {
            $and: [
              {creationDate: {$year: '2020'}},
              {creationDate: {$month: '12'}}
            ]
          }
        },
        {
          title: '2020.11',
          count: 3,
          queries: {
            $and: [
              {creationDate: {$year: '2020'}},
              {creationDate: {$month: '11'}}
            ]
          }
        },
        {
          title: '2020.10',
          count: 1,
          queries: {
            $and: [
              {creationDate: {$year: '2020'}},
              {creationDate: {$month: '10'}}
            ]
          }
        }
      ])
    },
    makeTagQuery(tagName: string): Queries {
      return {
        tag: tagName
      }
    },
    makeCategoryQuery(categoryName: string): Queries {
      return {
        category: categoryName
      }
    },
    getPost(id: string): Promise<Post> {
      return Promise.resolve(
        testPosts.find(v => v.id === id) as Post
      )
    },
    getPostSummaries(queries?: Queries | null, pagable?: Pageable): Promise<PostList<PostSummary>> {
      let filteredPosts = testPosts

      if (queries) {
        if ('tag' in queries) {
          filteredPosts = filteredPosts.filter(v =>
            !!v.tags.find(t => t.name === queries['tag'])
          )
        } else if ('category' in queries) {
          filteredPosts = filteredPosts.filter(v =>
            v.category && v.category.name === queries['category']
          )
        }
      }

      pagable = DefaultPageable.create(
        pagable && pagable.pageNumber || 1,
        pagable && pagable.pageSize || 5,
        filteredPosts.length,
        pagable && pagable.sort || defaultSortOrders
      )

      if (pagable.sort) {
        filteredPosts.sort((x, y) => {
          if (x.creationDate.getTime() < y.creationDate.getTime()) {
            return 1
          } else if (x.creationDate.getTime() > y.creationDate.getTime()) {
            return -1
          } else {
            return 0
          }
        })
      }

      const pagePosts = filteredPosts.slice(pagable.offset, pagable.offset + pagable.pageSize)
      return Promise.resolve({
        posts: pagePosts.map(v => ({
          ...v,
          content: v.content.substr(0, 100)
        })),

        pageable: pagable
      })
    }
  }
})

export default vuelogInstance
